import React, { useState } from 'react';
import './split.scss';

const RangeSlider: React.FC = () => {
  const [valueA, setValueA] = useState<number>(4);
  const [valueB, setValueB] = useState<number>(5);

  const handleValueChangeA = (event: React.ChangeEvent<HTMLInputElement>) => {
    const newValueA = parseFloat(event.target.value);
    setValueA(newValueA);
  };

  const handleValueChangeB = (event: React.ChangeEvent<HTMLInputElement>) => {
    const newValueB = parseFloat(event.target.value);
    setValueB(newValueB);
  };

  return (
    <>
      <div
        style={{
          width: '80vw',
          height: '50vh',
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div className="split-bottom">
        <div className="range-slider">
          <input
            type="range"
            min={1}
            max={9}
            value={valueA}
            onChange={handleValueChangeA}
          />
          <input
            type="range"
            min={2}
            max={10}
            value={valueB}
            onChange={handleValueChangeB}
          />
          <output />
          <div className="range-slider__progress" />
        </div>
      </div>
    </>
  );
};

export default RangeSlider;
